import { Card } from "antd";
import React from "react";

const PostCard = ({post}) => {
    return (
        <div>
            <Card
              cover={post.Images[0] && <PostImages images={post.Images}/>}
              actions
            >
                <Image />
                <Content />
                <Buttonss></Buttonss>
            </Card>
            <CommentForm />
            <Comments />
        </div>
    );
};

export default PostCard;
